import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import PokemonsListScreen from "../pages/PokemonsListScreen/PokemonsListScreen";
import PokemonDetailScreen from "../pages/PokemonDetailScreen/PokemonDetailScreen";
import PokedexScreen from "../pages/PokedexScreen/PokedexScreen";
import { ErrorPage } from "../pages/ErrorPage/ErrorPage";

const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={PokemonsListScreen} />
        <Route
          exact
          path="/pokemon/:name/:telaPokedex?"
          component={PokemonDetailScreen}
        />
        <Route exact path="/pokedex" />
            <PokedexScreen />
        <Route>
          <ErrorPage />
        </Route>
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
